import Link from "next/link";
import Head from "next/head";
import Layout from "../components/layout";

function About() {
  return (
    <div>
      <Layout>
        <Head>
          <title>About</title>
        </Head>
        <p>
          Just a fun SPA app built with Next.js to show off my love of Star
          Wars!
        </p>
        <Link href="/">
          <a>Back to Home</a>
        </Link>
      </Layout>
    </div>
  );
}

export default About;
